import { ReactDOM } from "react";
import '../App.css';
function DarkModeBtn(){
     
    return (
        <div className="dark-mode">
            <p>Dark Mode</p>
            <label className="switch">
                   <input type="checkbox" ></input>
                   <span className="slider round"></span>
            </label>
        </div>
    )
}

export default DarkModeBtn ;
